import React from "react";
import { View, Text, Button, StyleSheet } from "react-native";

export default function DetailsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Text style={styles.header}>Pick your desired bible</Text>
      <Button title="Old Testament" onPress={() => navigation.goBack()} />
      <Button title="New Testament" onPress={() => navigation.goBack()} />
      <Button title="Antiguo Testamento" onPress={() => navigation.goBack()} />
      <Button title="Nuevo Testamento" onPress={() => navigation.goBack()} />

      <Button
        color="black"
        title="Go back"
        onPress={() => navigation.goBack()}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  header: {
    textAlign: "center",
    fontSize: 32,
    marginBottom: 20,
  }
});
